INSERT INTO `tbl_payment_policy` (`id`, `uniqcode`, `ideal_for`, `description`, `status`, `datetime`) VALUES
(1, 'OoaieWPy9bu2hdnX6tNV', 'seller', '<h1>If your Amazon Seller account is suspended and you want to reinstate it, you are on the right way! We offer Amazon Seller account reinstatement service. With us you can be sure that you will receive best possible assistance and bespoke Appeal with Plan of Action.</h1>\r\n\r\n<h1>&nbsp;</h1>\r\n\r\n<h1>Just go to Order page, fill in the form carefully and make a payment. Within set time frame we will prepare everything needed and send it to you with all the guidelines. After that you should wait for your account reinstatement.</h1>\r\n', 'Delete', '2020-09-15 13:22:06'),
(2, 'l27vku4JTYXyZfaspw3j', 'seller', '<h1><strong>When will I get my payment?</strong><br />\r\nGenerally, Amazon first settles your account balance 14 days after you register your seller account. This means that Amazon will initiate a payment to your bank account on your settlement date. Subsequently, the settlement process repeats every 7 days.<br />\r\n<br />\r\nIn order to receive smooth online payment services from Amazon.in, you must have the following:<br />\r\n<br />\r\nA positive seller account balance. This means that the amount of money you made from sales is greater than the amount of fees and refunds you incurred during a settlement period.<br />\r\nValid bank account information in your seller account. Amazon.in pay the proceeds of sellers&#39; sales to their bank accounts by bank transfer, and to ensure smooth flow of payments you must provide valid information of your Indian bank account before you can receive payments.<br />\r\n<br />\r\nWhen your account is settled, Amazon posts a settlement report in the Reports section of Seller Central. Amazon also initiates payment to your bank account through an electronic bank transfer. It usually takes 2 to 3 working days for the funds to reach your bank account after Amazon has initiated a payment.</h1>\r\n', 'Delete', '2020-09-15 13:24:36'),
(3, 'SERb5JqULIXOsNHGzcdr', 'seller', '<p><strong>When will I get my payment?</strong><br />\r\nGenerally, Amazon first settles your account balance 14 days after you register your seller account. This means that Amazon will initiate a payment to your bank account on your settlement date. Subsequently, the settlement process repeats every 7 days.<br />\r\n<br />\r\n&nbsp;</p>\r\n', 'Active', '2020-09-15 13:36:50'),
(4, '1FUiR6sTgt0PvDE9fGHM', 'user', '<p>You will be allowed to&nbsp;<strong>use</strong>&nbsp;only one&nbsp;<strong>Amazon Pay</strong>&nbsp;balance: Money account at any given point of time. ... In addition, the available balance in such Min KYC account shall not exceed INR 10,000/- at any given point of time. The same balance will be available for purchases from merchants.&nbsp;</p>\r\n', 'Active', '2020-09-15 01:36:44');
