(8, '3FwNHu8pRL6zsVA2DPmU', 'user', '<p>The information we learn from customers helps us personalise and continually improve your shopping experience at Amazon.in. We use your information to assist sellers in handling orders, deliver products and services, process payments, communicate with you about orders, products, services and promotional offers, update our records and generally maintain your accounts with us, display content such as wish lists and customer reviews and recommend merchandise and services that might be of interest to you. We also use this information to improve our platform, prevent or detect fraud or abuses of our website and enable third parties to carry out technical, logistical or other functions on our behalf&nbsp;&nbsp;</p>\r\n', 'Active', '2020-09-15 10:55:08');
INSERT INTO `tbl_report_infringement` (`id`, `uniqcode`, `ideal_for`, `description`, `status`, `datetime`) VALUES
(1, 'M7Bvnxuks2lEzgoKNaJZ', 'user', '<p>About&nbsp;<strong>Amazon&#39;s Report Infringement</strong>&nbsp;Form</p>\r\n\r\n<p>Please&nbsp;<strong>report</strong>&nbsp;your concerns to&nbsp;<strong>Amazon</strong>&nbsp;through the appropriate venue: Sellers may&nbsp;<strong>use</strong>&nbsp;this form to&nbsp;<strong>report</strong>&nbsp;inappropriate listings, other sellers, policy violations, etc. Buyers may&nbsp;<strong>use</strong>&nbsp;this form to&nbsp;<strong>report</strong>&nbsp;problems with orders, seller policy violations, etc.&nbsp;</p>\r\n', 'Active', '2020-09-15 16:01:25'),
(2, 'v07HVNLJiFIRsqaUKPG2', 'seller', '<p>To submit a notice of IP infringement, you must be the Rights Owner who owns the IP being reported or an agent with permission from the Rights Owner to submit notices on his or her behalf. Do not forget to provide your contact details (name, address, phone number, email address, secondary contact details) when you report infringement.</p>\r\n', 'Active', '2020-09-15 16:01:24');
INSERT INTO `tbl_return_policy` (`id`, `uniqcode`, `ideal_for`, `description`, `status`, `datetime`) VALUES
(1, '2jCEuKQwO04pTrscDaYI', 'seller', '<p>Items within return window and in stock (exact same item) with same seller are eligible for free replacement. The free replacement order will be shipped through standard shipping once the original order is returned. Free replacements can be requested if the following conditions apply:</p>\r\n\r\n<ul>\r\n	<li>Item received is physically damaged;</li>\r\n	<li>Item received has missing parts or accessories;</li>\r\n	<li>Item received is different from their description on the product detail page on Amazon.in; or</li>\r\n	<li>Item received is defective/does not work properly.&nbsp;</li>\r\n</ul>\r\n', 'Active', '2020-09-15 13:01:41'),
(2, 'GhDZ1s6RVcl2oNHOUQmL', 'user', '<p>Which items are eligible for a Free&nbsp;<strong>Replacement</strong>? Fulfilled by&nbsp;<strong>Amazon</strong>&nbsp;items, Prime eligible items and few&nbsp;<strong>Seller</strong>&nbsp;Fulfilled items are eligible for free replacements. If an eligible item is out of stock from the same&nbsp;<strong>seller</strong>, it cannot be&nbsp;<strong>replaced</strong>.</p>\r\n', 'Active', '2020-09-15 13:01:13');
INSERT INTO `tbl_security` (`id`, `uniqcode`, `ideal_for`, `description`, `status`, `datetime`) VALUES
(1, 'H2euj0VXy3ZEDwcvz1nT', '', '<p>Interest-based ads are sometimes referred to as personalized or targeted ads. We show interest-based ads to display features, products, and services that might be of interest to you. In providing interest-based ads, we follow the Self-Regulatory Principles for Online Behavioral Advertising developed by the Digital Advertising Alliance (a coalition of marketing, online advertising, and consumer advocacy organizations).</p>\r\n', 'Delete', '2020-09-15 14:26:18'),
(2, 'xQjAu7iB1rZLovy96Dd3', '', '<p>Interest-based ads are sometimes referred to as personalized or targeted ads. We show interest-based ads to display features, products, and services that might be of interest to you. In providing interest-based ads, we follow the Self-Regulatory Principles for Online Behavioral Advertising developed by the Digital Advertising Alliance (a coalition of marketing, online advertising, and consumer advocacy organizations).</p>\r\n', 'Delete', '2020-09-15 14:25:55'),
(3, 'uXDRVQd6y4ST3qfH2mvF', 'user', '<p>Interest-based ads are sometimes referred to as personalized or targeted ads. We show interest-based ads to display features, products, and services that might be of interest to you. In providing interest-based ads, we follow the Self-Regulatory Principles for Online Behavioral Advertising developed by the Digital Advertising Alliance (a coalition of marketing, online advertising, and consumer advocacy organizations.&nbsp;</p>\r\n', 'Active', '2020-09-15 14:34:09'),
(4, 'wliXbQareMNISgx3k1Do', 'seller', '<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Pick strong passwords that are different for each of your accounts and&nbsp;&nbsp;regularly.\r\n	<ul>\r\n		<li>Choosing the same password for each of your online accounts is like using the same key to lock your home, car and office &ndash; if a criminal gains access to one, all of them are compromised.</li>\r\n		<li>Use a long password made up of numbers, letters and symbols.</li>\r\n		<li>Avoid using publicly-available information (For example: your phone number) in your passwords.</li>\r\n	</ul>\r\n	</li>\r\n</ol>\r\n', 'Active', '2020-09-15 02:33:43');
INSERT INTO `tbl_shipping_policy` (`id`, `uniqcode`, `ideal_for`, `description`, `status`, `datetime`) VALUES
(1, 'JXQACoDljLteZG7xaRBf', 'user', '<p>Launched in India in May 2015, Amazon&rsquo;s Global Selling Program facilitates easy, simple and convenient access for you to sell your products to consumers across the globe from India. Currently, over&nbsp;<strong>60,000</strong>&nbsp;Indian manufacturers, sellers and exporters are using this platform to sell their offerings across Amazon&#39;s 15 international marketplaces. The program offers a comprehensive suite of end-to-end solutions that include assisting you with imaging, logistics, tax advisory and remittance. In 2017 we launched Diwali store on amazon.com to exclusively showcase Indian products.</p>\r\n', 'Active', '2020-09-15 15:01:53'),
(2, 'iXPeAzZubdtNB0WsphVf', 'seller', '<p>Fulfillment by Amazon: FBA or Fulfillment by Amazon is a service that allows sellers to stock their products at a warehouse or a fulfillment center managed entirely by Amazon. All that a seller has to do is send their products to one of the fulfillment centers and relax. As soon as the products are received at the fulfillment centers, Amazon executives stock it up with care, pack it when an order is received, prepare it for delivery and deliver the order. This also includes managing returns. As sellers, all you need to do is keep a check on how much stock is available so you can restock it on time.</p>\r\n', 'Active', '2020-09-15 15:01:57');
