(1, 'uYP3HSTDtLNorkbeWJh4', 'user', '<p>To help us make e-mails more useful and interesting, we often receive a confirmation when you open e-mail from Amazon.in if your computer supports such capabilities. We also compare our customer list to lists received from other companies in an effort to avoid sending unnecessary messages to our customers. If you do not want to receive e-mail or other mail from us, please adjust your Customer Communication Preferences.</p>\r\n', 'Active', '2020-09-14 17:24:48'),
(2, 'JoiDIFCLSPgpd4weXvYh', 'seller', '<p>Because you can showcase your products to crores of customers &amp; businesses - 24 hours a day - on India&#39;s most visited shopping destination. More than 5 lakh businesses, big and small, sell on Amazon today. Start your selling journey with us and expand your business reach.</p>\r\n', 'Active', '2020-09-14 16:48:42');
